    {
        name:'khatia',
        email:'khatiavhub@mail.com',
        age:24
    },
    {
        name:'lili',
        email:'lilisissv@mail.com',
        age:'24'
    }
]

export default function RoomDescription(){
    const params=useParams();
    console.log(params);
    // const[state,setState]=useState([data])
    return(
        <>
        <div>room description</div>
        {data.map((element,i)=>{
            return(
                <div>
                    <div key={i}>
                    <p>{element.age}</p>
                </div>
                </div>
            )
        })}
        </>
        
    )
}
